INSERT INTO `v1_b1504917bb2e238be20cf7ba573e6a1e1af339b17920259608e1b7f0c6ff8a30` VALUES (0, "そうどすえ♪\nみんなで踊りながら、お祝いしまひょ♪\nカスミはんのために、王子はんも\n準備を手伝ってくれたんよ♪", 101011, 11, 1, 26224073, 10, 0, 0.5, 26224, 1);
