INSERT INTO `v1_b1504917bb2e238be20cf7ba573e6a1e1af339b17920259608e1b7f0c6ff8a30` VALUES (0, "私からは本をプレゼントするわ。\nタイトルは「猫でもできる節約術」よ。\n日々の倹約に役立ててちょうだい。", 104811, 11, 1, 38014068, 10, 0, 0.5, 38014, 1);
