INSERT INTO `v1_b1504917bb2e238be20cf7ba573e6a1e1af339b17920259608e1b7f0c6ff8a30` VALUES (0, "あら、私も本なのよ。\n「猫でもわかる麦しゅわの歴史」って\n本だけど、これを読んで麦しゅわへの\n理解を深めてね♪", 103411, 11, 1, 38014073, 10, 0, 0.5, 38014, 1);
